window.bookSummaryJSON = "<p>All Azure wants to do is leave The Realm, but the Bower Boys throw a wrench in his plans. </p> <p>Mistakes that Azure made when he first joined The Adventurers Guild come back to haunt him. Uden flexes between good and evil once more as he's put in a precarious situation. </p> <p>Is vengeance worth endangering all of your friends and possibly dying for? Azure answers that question with steel, taking a path he never thought he'd travel. Once he set foot down it, there was no going back. </p> <p>Decisions were made and someone will pay the ultimate price.</p>"; 
